subSubSection.paragraph:
Colour.
Antennae, palpi and head reddish-brown, posterior angles of head, near eyes and base of pronotum in middle broadly dark brown to black, in some specimens totally blackish-brown. Elytron dark brown or black with distinct yellowish markings basally, subbasally and subapically (
Fig. 9
). Ventral side, including legs and epipleura, reddish-brown, prosternal process and metacoxal plates somewhat darkened. In several specimens yellowish pattern reduced to variable extent, thus, sometimes head, pronotum and elytron almost totally black, lacking yellowish markings on pronotum and elytra except two small spots apically (
Fig. 10
).
